import React from 'react';
import Logo from './Logo';
import '../styles/Navbar.css';

const Navbar = () => {
    return (
        <div>
            <Logo />
            <ul>
                <li>
                    Profile
                </li>
                <li>
                    Logout
                </li>
            </ul>
        </div>
    );
};

export default Navbar;
